 <script>
    	var clickTag = "https://www.markten.com/";
    	var clickTag_B = "https://www.markten.com/store-locator";

		window.onload = function() {
			var legalOpen = document.getElementById("legalOpen");
			var legalClose = document.getElementById("legalClose");
			var legal = document.getElementById("legal");
			var hotspot = document.getElementById("hotspot");
			var find_store = document.getElementById("find_store");

			hotspot.addEventListener("click", onHotSpotClick, false);
			find_store.addEventListener("click", onFindStoreClick, false);
		    legalOpen.addEventListener("click", onLegalClick,false);
		    legalClose.addEventListener("click", onCloseClick,false);
		    
		    function onHotSpotClick(){
    			window.open(window.clickTag,'_blank');
			}
		    function onFindStoreClick(){
    			window.open(window.clickTag_B,'_blank');
			}
			function onLegalClick(e){
			 legal.style.top = "0px";
			    LegalOut = true;  
			}

			function hotSpotShow(e) {
			    find_store.style.display= "block";
			}

			function legalOpenHide(e) {
			    legalOpen.style.display= "none";
			    legal.style.display="none";
			    hotspot.style.display= "none";
			}

			function legalOpenShow(e) {
			    legalOpen.style.display= "block";
			    legal.style.display="block";
			    hotspot.style.display= "block";
			}

    		setTimeout(hotSpotShow, 18800);
    		setTimeout(legalOpenHide, 14000);
    		setTimeout(legalOpenShow, 21600);

			function onCloseClick(e){
			 if(LegalOut){
			  legal.style.top = "250px";
			  LegalOut=false;
		 		}
		 	}
		}        
  	</script>
